sections.code:
    body {
        background-color: #f6f9fa;
    }
    #rs,
    #page>* {
        background-color: rgba(0, 0, 0, 0.001) !important;
    }
    #head {
        box-shadow: 0 2px 2px 0 rgba(0, 0, 0, 0.14), 0 1px 5px 0 rgba(0, 0, 0, 0.12), 0 3px 1px -2px rgba(0, 0, 0, 0.2);
    }
    #u {
        visibility: hidden;
    }
    /* 头部剧中 */
    #head .head_wrapper {
        display: flex !important;
        justify-content: space-around !important;
    }
    #head .headBlock {
        /* 	margin-left: 0px !important; */
        display: none !important;
        justify-content: center !important;
    }
    /* 屏蔽推荐 */
    .rrecom-btn-parent {
        display: none;
    }
    #s_tab {
        display: flex !important;
        justify-content: center;
        padding-left: 0px;
    }
    .s_tab_inner >*:hover {
        background-color: #4791ffc9;
        transition: background-color .3s;
    }
    #s_tab b {
        border-bottom: 0;
    }
    /* 修改输入框样式 */
    .bg,
    .s_ipt_wr,
    .quickdelete-wrap {
        border-top: 0px;
        border-left: 0px;
    }
    .s_ipt_wr,
    .ipthover {
        border-bottom: 1px solid #3385ff !important;
    }
    bg s_btnhover {
        background-color: #2bbbad !important;
        box-shadow: 0 3px 3px 0 rgba(0, 0, 0, 0.14), 0 1px 7px 0 rgba(0, 0, 0, 0.12), 0 3px 1px -1px rgba(0, 0, 0, 0.2) !important;
    }
    .s_btn {
        border-radius: 2px;
        box-shadow: 0 2px 2px 0 rgba(0, 0, 0, 0.14), 0 1px 5px 0 rgba(0, 0, 0, 0.12), 0 3px 1px -2px rgba(0, 0, 0, 0.2);
        transition: .3s ease-out;
        border: 0px;
    }
    .bg,
    .s_btn_wr {
        margin-left: 5px;
    }
    /* 优化搜索结果 */
    em {
        background-color: yellow;
        font-style: normal;
        color: #00c;
    }
    h3 {
        text-decoration: none;
    }
    #content_right {
        visibility: hidden;
    }
    .search_tool_conter {
        display: none;
    }
    .nums {
        visibility: hidden;
    }
    .c-container table {
        margin-left: 0px;
    }
    #container {
        margin: 0 auto;
    }
    .c-recommend {
        border: 0;
    }
    .container_l #content_right {
        visibility: hidden;
    }
    .c-container {
        background-color: #fff;
        /*     border-left: 2px solid #3385ff;
    border-right: 2px solid #3385ff; */
        border-radius: 2px;
        padding-left: 130px;
        padding-top: 20px;
        padding-bottom: 20px;
        box-shadow: 0 2px 2px 0 rgba(0, 0, 0, 0.14), 0 1px 5px 0 rgba(0, 0, 0, 0.12), 0 3px 1px -2px rgba(0, 0, 0, 0.2);
        width: 900px;
        margin-top: 20px;
    }
