    box-shadow: 0px 00px 40px rgba(168, 182, 191, .7);
} */
    /* 结果字体 */
    a:-webkit-any-link {
        text-decoration: none;
    }
    a em {
        text-decoration: none;
    }
    h3 {
        text-decoration: none;
    }
    /* 结果宽度 */
    .c-abstract,
    .c-offset {
        width: 700px;
    }
    .subLink_factory {
        margin-left: 0px;
        width: 700px;
    }
    /* 输入框阴影效果 */
    #head.s_down {
        box-shadow: 0 0 20px rgba(0, 0, 0, .7);
    }
    /* 尾部局中*/
    #rs,
    #page {
        margin-top: 120px;
        text-align: center;
        margin: 0 auto;
    }
    #rs table a {
        text-decoration: none;
        text-align: center;
    }
    .tt {
        margin-bottom: 10px;
        border-bottom: 1px solid #ccc;
    }
    /* 尾部推荐居中 */
    #rs th {
        text-align: center;
    }
    #rs table {
        text-align: center;
        margin-left: 30px;
    }
    #page {
        margin-top: 60px;
        padding-left: 0px;
        /*     margin-left: -40px; */
    }
    #page .c-icon {
        visibility: hidden;
    }
    #foot {
        visibility: hidden;
    }
    #page .pc,
    #page .n {
        color: #fff;
        background-color: rgb(51, 133, 255) !important;
        border: 0px;
        box-shadow: rgba(0, 0, 0, 0.14) 0px 2px 2px 0px, rgba(0, 0, 0, 0.12) 0px 1px 5px 0px, rgba(0, 0, 0, 0.2) 0px 3px 1px -2px !important;
        border-radius: 2px;
    }
    #page .n:hover,
    #page .pc:hover {
        transition: 0.3s ease-out;
        box-shadow: rgba(0, 0, 0, 0.14) 0px 3px 3px 0px, rgba(0, 0, 0, 0.12) 0px 1px 7px 0px, rgba(0, 0, 0, 0.2) 0px 3px 1px -1px !important;
        background: rgba(51, 133, 255, 0.7) !important;
        border: 0px !important;
    }
    /*========= Ad Block ========= */
    div[style*="visibility:visible"] {
        display: none !important;
        visibility: hidden !important;
        opacity: 0;
        height: 0px;
        overflow: hidden;
    }
    body>div[style*='position: absolute;'],
    body>div[style*='position: fixed;'],
    #contnet_left>div[id="10"]~div[id="1"],
#contnet_left>div[id="20"]~div[id="1"],
#contnet_left>div[id="40"]~div[id="1"],
#contnet_left>div[id="60"]~div[id="1"],
#contnet_left>div[id="80"]~div[id="1"],
#contnet_left>div[id="100"]~div[id="1"],
#content_left>div:not([id]) {
    display: none !important;
}

#content_left>div[style*="display:block !important"] {
    position: absolute !important;
    top: -5000px !important;
}

